import React, { Fragment } from 'react';
import './App.css';

import Calendar from './components/Calendar';

function App() {
  return (
    <Fragment>
      <section className="hero is-primary">
      </section>
      <div className="container">
        <Calendar />
      </div>
    </Fragment>
  );
}

export default App;
